import React , { useState, useEffect } from 'react';
import './OrderMng.css';
import OrderMngNav from './OrderMngNav.jsx';
import OrderMngTable from './OrderMngTable.jsx'
import CompletedOrders from './CompletedOrders.jsx'
import OrderHistory from './OrderHistory.jsx'
import ReactBootstrap, {Nav, Button, Navbar,NavDropdown} from 'react-bootstrap';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';

function OrderMng() {

	


		return(
			<Router>
				<div className='tc'>
					<OrderMngNav states={[one,two,three]}/>
					<Switch>

						
						<Route path="/completedOrders"><CompletedOrders/></Route>
						<Route path="/history"><OrderHistory/></Route>
						<Route path = "/order"><OrderMngTable/></Route>
					</Switch>
				</div>
			</Router>
		);

}

// class OrderMng extends Component{
